import './App.css';
import ProfilePage from "./app/ProfilePage";
import ReservationCheck from "./app/components/reservationCheckForm";
import InfoBox from "./app/components/InfoBox";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import {Layout} from "antd";
import 'bootstrap/dist/css/bootstrap.min.css';
import '@fortawesome/react-fontawesome';
import '@fortawesome/free-solid-svg-icons';
import MenuTab from "./app/components/MenuTab";
import CoursePage from "./app/CoursePage";
import Dashboard from './app/Dashboard';
import NewSeatingPlanForm from "./app/components/NewSeatingPlanForm";
import SeatingPlan from "./app/components/SeatingPlan";
const {Header, Content} = Layout;

function App() {


  return (

      <>
          <div>
              <Router>
                  <Header>
                      <div>
                          <MenuTab  />
                      </div>
                  </Header>
                  <Content>

                      <Switch>
                          <Route path="/home">
                              <Dashboard/>
                          </Route>
                          <Route path="/appointment">
                             <ReservationCheck/>    
                          </Route>
                          <Route path="/profile">
                              <ProfilePage role = "student" id ="11111"/>
                          </Route>
                          <Route path= "/campusmap">
                             <CoursePage/>
                          </Route>
                          <Route path= "/logout">
                              <SeatingPlan/>
                          </Route>
                          <Route path="/notifications" >
                              <NewSeatingPlanForm/>
                          </Route>
                      </Switch>

                  </Content>
              </Router>
          </div>
      </>
  );
}

export default App;
